import React, { Component } from "react";

class Process extends Component {
  state = {
    processName: "Proceso numero 1"
  };

  styles = {
    fontSize: 100,
    fontWeight: "bold"
  };

  render() {
    return (
      <div>
        <span>
          <span styles={this.styles} className="badge badge-primary m-2">
            {this.state.processName}
          </span>
          <button type="button" class="btn btn-default" aria-label="Left Align">
            <span class="glyphicon glyphicon-align-left" aria-hidden="true" />
          </button>
          <button className="btn btn-primary btn-sm m-1">View</button>
          <button className="btn btn-secondary btn-sm m-1">Edit</button>
          <button className="btn btn-secondary btn-sm m-1">Delete</button>
        </span>
      </div>
    );
  }
}

export default Process;
